Подведём итоги проделанной работы:

\begin{align*}
  &\text{$S$ с единицей $E$} \to R(S) \to M \text{ — $\sigma$-алгебра} \\
  &\text{$m$ — $\sigma$-аддативная мера} \to \nu \to \mu \text{ — $\sigma$-аддативная мера}
\end{align*}

Мы смогли продолжить $m$ на $\sigma(S)$. Почему? Потому что $\sigma(S) \subseteq M$ по определению. Возникает вопрос: «А единственна ли мера, определённая на $\sigma(S)$?» Окажется, что да.
